import React, { useState } from 'react';

function Navbar({ onSectionChange }) {
    const [currentSection, setCurrentSection] = useState('home');

    const handleSectionChange = (section) => {
        setCurrentSection(section);
        onSectionChange(section);
    };

    return (
        <nav className="sticky top-0 z-50 w-full border-b border-border/40 bg-background/95 backdrop-blur supports-[backdrop-filter]:bg-background/60">
            <div className="container flex h-14 max-w-screen-2xl items-center">
                <div className="mr-4 hidden md:flex">
                    <a className="mr-6 flex items-center space-x-2" href="/">
                        <img src="/humiclogo.svg" alt="HUMIC Logo" className="h-6 w-6" />
                        <span className="hidden font-bold sm:inline-block">HUMIC</span>
                    </a>
                    <nav className="flex items-center gap-6 text-sm">
                        <button
                            onClick={() => handleSectionChange('home')}
                            className={`transition-colors hover:text-foreground/80 ${currentSection === 'home' ? 'text-foreground' : 'text-foreground/60'}`}
                        >
                            Home
                        </button>
                        <button
                            onClick={() => handleSectionChange('about')}
                            className={`transition-colors hover:text-foreground/80 ${currentSection === 'about' ? 'text-foreground' : 'text-foreground/60'}`}
                        >
                            About
                        </button>
                        <button
                            onClick={() => handleSectionChange('team')}
                            className={`transition-colors hover:text-foreground/80 ${currentSection === 'team' ? 'text-foreground' : 'text-foreground/60'}`}
                        >
                            Team
                        </button>
                        <button
                            onClick={() => handleSectionChange('events')}
                            className={`transition-colors hover:text-foreground/80 ${currentSection === 'events' ? 'text-foreground' : 'text-foreground/60'}`}
                        >
                            Activities
                        </button>
                        <button
                            onClick={() => handleSectionChange('conuai')}
                            className={`transition-colors hover:text-foreground/80 ${currentSection === 'conuai' ? 'text-foreground' : 'text-foreground/60'}`}
                        >
                            ConuAI
                        </button>
                        <button
                            onClick={() => handleSectionChange('quantfund')}
                            className={`transition-colors hover:text-foreground/80 ${currentSection === 'quantfund' ? 'text-foreground' : 'text-foreground/60'}`}
                        >
                            Quant Fund
                        </button>
                    </nav>
                </div>
                <div className="flex flex-1 items-center justify-between space-x-2 md:justify-end">
                    <div className="w-full flex-1 md:w-auto md:flex-none">
                        {/* Add any additional header items here */}
                    </div>
                    <nav className="flex items-center">
                        {/* Add any right-side nav items here */}
                    </nav>
                </div>
            </div>
        </nav>
    );
}

export default Navbar;
